pragma solidity >=0.6.0 <0.8.0;

import "openzeppelin-solidity/contracts/token/ERC20/ERC20.sol";
import "openzeppelin-solidity/contracts/token/ERC20/ERC20Pausable.sol";
import "openzeppelin-solidity/contracts/access/Ownable.sol";

contract Allostasis is Ownable, Pausable {
    /**
    * @dev Details of each transfer
    * @param contract_ contract address of ER20 token to transfer
    * @param to_ receiving account
    * @param amount_ number of tokens to transfer to_ account
    * @param type_ type of entity
    * @param relation1_ relation part 1 of entity
    * @param relation2_ relation part 2 of entity
    * @param failed_ if transfer was successful or not
    */
    struct Transfer {
        address contract_;
        address to_;
        address from_;
        uint amount_;
        bytes32 type_;
        bytes32 relation1_;
        bytes32 relation2_;
        bool failed_;
    }

    /**
    * @dev a mapping from transaction ID's to the sender address
    * that initiates them. Owners can create several transactions
    */
    mapping(address => uint[]) public transactionIndexesToSender;

    /**
    * @dev a list of all transfers successful or unsuccessful
    */
    Transfer[] public transactions;

    /**
    * @dev Details of each Entity
    * @param type_ type of entity
    * @param relation1_ relation part 1 of content
    * @param relation2_ relation part 2 of content
    * @param owner_ owner of entity
    * @param to_ target user
    * @param access_ have access or not
    */
    struct Entity {
        bytes32 type_;
        bytes32 relation1_;
        bytes32 relation2_;
        address owner_;
        address to_;
        bool access_;
    }

    /**
    * @dev a mapping from entity ID's to the owner address
    * that initiates them. Owners can create several entities
    */
    mapping(address => uint[]) public entityIndexesToOwner;

    /**
    * @dev a mapping from entity ID's to the target address
    * that initiates them. Targets can gave several entities
    */
    mapping(address => uint[]) public entityIndexesToTarget;

    /**
    * @dev a mapping from entity ID's to the relation1
    */
    mapping(bytes32 => uint[]) public entityIndexesToRelation1;

    /**
    * @dev a mapping from entity ID's to the relation2
    */
    mapping(bytes32 => uint[]) public entityIndexesToRelation2;

    /**
    * @dev a list of all entities
    */
    Entity[] public entities;

    /**
    * @dev list of all supported tokens for transfer
    * address contract address of token
    */
    mapping(bytes32 => address) public tokens;

    ERC20 public ERC20Interface;

    /**
    * @dev Event to notify if transfer successful or failed
    * after account approval verified
    */
    event TransferSuccessful(address indexed from_, address indexed to_, uint256 amount_);

    event TransferFailed(address indexed from_, address indexed to_, uint256 amount_);

    constructor() Ownable() public {}

    /**
    * @dev add address of token to list of supported tokens using
    * token symbol as identifier in mapping
    */
    function addNewToken(bytes32 symbol_, address address_) public onlyOwner returns (bool) {
        tokens[symbol_] = address_;

        return true;
    }

    /**
    * @dev remove address of token we no more support
    */
    function removeToken(bytes32 symbol_) public onlyOwner returns (bool) {
        require(tokens[symbol_] != address(0));

        delete(tokens[symbol_]);

        return true;
    }

    /**
    * @dev method that handles creating entity
    * @param type_ type of entity
    * @param relation1_ related part 1 of entity
    * @param relation2_ related part 2 of entity
    */
    function createEntity(bytes32 type_, bytes32 relation1_, bytes32 relation2_) public whenNotPaused {
        address from_ = msg.sender;

        bool isDuplicate = false;
        if (entityIndexesToRelation1[relation1_].length > 0 || entityIndexesToRelation2[relation2_].length > 0) {
            isDuplicate = true;
        }

        if (isDuplicate == false) {
            entities.push(
                Entity({
                    type_: type_,
                    relation1_: relation1_,
                    relation2_: relation2_,
                    to_: from_,
                    owner_: from_,
                    access_: true
                })
            );

            uint256 entityId = entities.length;

            entityIndexesToOwner[from_].push(entityId - 1);
            entityIndexesToRelation1[relation1_].push(entityId - 1);
            entityIndexesToRelation2[relation2_].push(entityId - 1);
        }
    }

    /**
    * @dev method that handles granting access to entity
    * @param type_ type of entity
    * @param relation1_ related part 1 of entity
    * @param relation2_ related part 2 of entity
    * @param to_ address of target user
    * @param access_ has access or not
    */
    function accessEntity(bytes32 type_, bytes32 relation1_, bytes32 relation2_, address to_, bool access_) public whenNotPaused {
        address from_ = msg.sender;

        if (from_ != to_) {
            bool isOwner = false;
            for (uint i = 0; i < entityIndexesToOwner[from_].length; i++) {
                uint entityIndex = entityIndexesToOwner[from_][i];

                if (entities[entityIndex].type_ == type_ && entities[entityIndex].relation1_ == relation1_ && entities[entityIndex].relation2_ == relation2_) {
                    isOwner = true;
                    break;
                }
            }

            if (isOwner == true) {
                entities.push(
                    Entity({
                        type_: type_,
                        relation1_: relation1_,
                        relation2_: relation2_,
                        to_: to_,
                        owner_: from_,
                        access_: access_
                    })
                );

                uint256 entityId = entities.length;

                entityIndexesToTarget[to_].push(entityId - 1);
                entityIndexesToRelation1[relation1_].push(entityId - 1);
                entityIndexesToRelation2[relation2_].push(entityId - 1);
            }
        }
    }

    /**
    * @dev method that handles transfer of ERC20 tokens to other address
    * it assumes the calling address has approved this contract
    * as spender
    * @param symbol_ identifier mapping to a token contract address
    * @param to_ beneficiary address
    * @param amount_ numbers of token to transfer
    * @param type_ type of entity
    * @param relation1_ related part 1 of entity
    * @param relation2_ related part 2 of entity
    */
    function transferTokens(bytes32 symbol_, address to_, uint256 amount_, bytes32 type_, bytes32 relation1_, bytes32 relation2_) public whenNotPaused {
        require(tokens[symbol_] != address(0));
        require(amount_ > 0);

        address contract_ = tokens[symbol_];
        address from_ = msg.sender;

        ERC20Interface = ERC20(contract_);

        transactions.push(
            Transfer({
                contract_: contract_,
                to_: to_,
                from_: from_,
                amount_: amount_,
                type_: type_,
                relation1_: relation1_,
                relation2_: relation2_,
                failed_: true
            })
        );
        uint256 transactionId = transactions.length;

        transactionIndexesToSender[from_].push(transactionId - 1);

        if(amount_ > ERC20Interface.allowance(from_, address(this))) {
            emit TransferFailed(from_, to_, amount_);
            revert();
        }

        ERC20Interface.transferFrom(from_, to_, amount_);

        transactions[transactionId - 1].failed_ = false;

        emit TransferSuccessful(from_, to_, amount_);
    }

    /**
    * @dev allow contract to receive funds
    */
    event Received(address, uint);
    receive() external payable {
        emit Received(msg.sender, msg.value);
    }

    /**
    * @dev withdraw funds from this contract
    * @param beneficiary address to receive ether
    */
    function withdraw(address payable beneficiary) public payable onlyOwner whenNotPaused {
        beneficiary.transfer(address(this).balance);
    }

    /**
    * @dev validates to check if user can decrypt the entity using LIT
    * @param type_ is the type of entity
    * @param relation1_ is the part 1 of entity
    * @param relation2_ is the part 2 of entity
    */
    function canDecrypt(address from_, bytes32 type_, bytes32 relation1_, bytes32 relation2_) public view virtual returns (bool) {
        // Buyers can always decrypt
        for (uint i = 0; i < transactionIndexesToSender[from_].length; i++) {
            uint txIndex = transactionIndexesToSender[from_][i];

            if (transactions[txIndex].type_ == type_ && transactions[txIndex].relation1_ == relation1_ && transactions[txIndex].relation2_ == relation2_) {
                return true;
            }
        }

        // Owners can always decrypt
        for (uint i = 0; i < entityIndexesToOwner[from_].length; i++) {
            uint entityIndex = entityIndexesToOwner[from_][i];

            if (entities[entityIndex].type_ == type_ && entities[entityIndex].relation1_ == relation1_ && entities[entityIndex].relation2_ == relation2_) {
                return true;
            }
        }

        // Users with permission can decrypt if last status is true
        for (uint i = entityIndexesToTarget[from_].length; i > 0; i--) {
            uint entityIndex = entityIndexesToTarget[from_][i - 1];

            if (entities[entityIndex].type_ == type_ && entities[entityIndex].relation1_ == relation1_ && entities[entityIndex].relation2_ == relation2_) {
                if (entities[entityIndex].access_ == false) {
                    return false;
                } else {
                    return true;
                }
            }
        }

        return false;
    }

    /**
    * @dev returns wallets of buyers of the entity
    * @param type_ is the type of entity
    * @param relation1_ is the part 1 of entity
    * @param relation2_ is the part 2 of entity
    */
    function entityBuyers(bytes32 type_, bytes32 relation1_, bytes32 relation2_) public view virtual returns (address[] memory) {
        uint addressesCount = 1;

        for (uint i = 0; i < transactions.length; i++) {
            if (transactions[i].type_ == type_ && transactions[i].relation1_ == relation1_ && transactions[i].relation2_ == relation2_) {
                addressesCount = addressesCount + 1;
            }
        }

        address[] memory addresses = new address[](addressesCount);

        uint push_i = 0;
        for (uint i = 0; i < transactions.length; i++) {
            if (transactions[i].type_ == type_ && transactions[i].relation1_ == relation1_ && transactions[i].relation2_ == relation2_) {
                addresses[push_i] = transactions[i].from_;
                push_i = push_i + 1;
            }
        }

        return addresses;
    }

    /**
    * @dev returns wallets which have permission of the entity
    * @param type_ is the type of entity
    * @param relation1_ is the part 1 of entity
    * @param relation2_ is the part 2 of entity
    */
    function entityPermissions(bytes32 type_, bytes32 relation1_, bytes32 relation2_) public view virtual returns (address[] memory) {
        uint addressesCount = 1;

        for (uint i = entityIndexesToRelation1[relation1_].length; i > 0; i--) {
            uint entityIndex = entityIndexesToRelation1[relation1_][i - 1];

            if (entityIndexesToRelation2[relation2_][i - 1] == entityIndexesToRelation1[relation1_][i - 1] && entities[entityIndex].type_ == type_) {
                addressesCount = addressesCount + 1;
            }
        }

        address[] memory addresses = new address[](addressesCount);
        address[] memory addressesChecked = new address[](addressesCount);

        uint push_i = 0;
        uint push_j = 0;
        for (uint i = entityIndexesToRelation1[relation1_].length; i > 0; i--) {
            uint entityIndex = entityIndexesToRelation1[relation1_][i - 1];

            if (entityIndexesToRelation2[relation2_][i - 1] == entityIndexesToRelation1[relation1_][i - 1] && entities[entityIndex].type_ == type_) {
                bool checked = false;
                for (uint j = 0; j < addressesChecked.length; j++) {
                    if (addressesChecked[j] == entities[entityIndex].to_) {
                        checked = true;
                        break;
                    }
                }

                if (checked == false) {
                    addressesChecked[push_j] = entities[entityIndex].to_;
                    push_j = push_j + 1;

                    if (entities[entityIndex].access_ == true) {
                        addresses[push_i] = entities[entityIndex].to_;
                        push_i = push_i + 1;
                    }
                }
            }
        }

        return addresses;
    }
}

